import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  var fecha = Date.now
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        
        <h2>Hola Miguel + </h2>
      </header>
    </div>
   );
}

export default App;
